messages__text:
Следственный комитет возбудил 21 уголовное дело по фактам массовых беспорядков и насилия в отношении сотрудников органов внутренних дел в ночь с 9 на 10 августа.

Уголовные дела возбудили по следующим статьям:

ст. 293 (массовые беспорядки);
ч.2 ст. 363 (сопротивление сотруднику органов внутренних дел, сопряженное с применением насилия или угрозой его применения);
ст. 364 (насилие либо угроза применения насилия в отношении сотрудника органов внутренних дел);
ч.1 ст. 339 (хулиганство);
ст. 342 (организация и подготовка действий, грубо нарушающих общественный порядок, либо активное участие в них).

Задержаны более 80 человек. Большинство их них — молодые люди в возрасте 20−25 лет.

«Часть подозреваемых в момент задержания находились в состоянии наркотического или алкогольного опьянения», — сообщили в ведомстве.

Работники БМЗ передали генеральному директору список требований, под ними подписалось порядка 2 тысяч работников. Требования следующие:
• отставка действующего президента, Совета министров, Совета республики и Палаты представителей;
• проведение новых президентских выборов с допуском независимых наблюдателей, а также наблюдателей из ООН и ЕС;
• снятие обвинений с политических заключенных и их немедленное освобождение;
• не задерживать тех, кто не нарушает общественный порядок, не призывает к насилию, не наносит урон имуществу, не совершает другие уголовно и административно наказуемые деяния, а также освободить тех, кто был задержаны во время проведения мирных акций, без применения к ним штрафных санкций;
• руководству предприятия незамедлительно письменно уведомить местные органы исполнительной, законодательной и судебной власти об обеспокоенности сложившейся общественно-политической обстановкой.

 продолжался ровно час. По нашим (и не только) прикидкам, было тысяч 6−7 митингующих. Перед собравшимися выступали чиновники городского и областного уровней.

Что там было — вкратце:

• «Не дадим развалить страну»;
• «Пока мы едины, мы непобедимы»;
• «Мы все видели, что творилось в Украине».

 собирают подписи под открытым обращением к народу Беларуси, которое содержит шесть «глобальных требований»:

•Отставка Александра Лукашенко с поста президента Республики Беларусь в связи с утратой доверия;
•Отставка ЦИК во главе с Лидией Ермошиной;
•Освобождение всех политзаключенных и задержанных в ходе мирных акций протеста;
•Прекращение насилия и преследования мирных граждан со стороны силовых структур;
•Расследование всех случаев насилия над протестующими (и не протестующими) и привлечение к ответственности виновных;
•Новые, прозрачные и честные выборы с привлечением международных наблюдателей.

Начальник отдела реализации нефтепродуктов Ольга Бритикова говорит о давлении со стороны руководства — начальники угрожают «не продлить контракт».

Речь идет о приостановке дополнительных взносов по трем вкладам Белгазпромбанка:

«На 30 дней безотзывный — оптимальный» в долларах США и евро;
«ON-Вклад (v.2.8)» в долларах США;
«ON-Вклад (v.3.8)» в евро.

— Новый вклад можно открыть, но без возможности пополнения в течение срока вклада, — уточнили в контакт-центре Белгазпромбанка.

Они обеспокоены происходящим в стране после президентских выборов. 

Подписавшие письмо просят:

- отставки Александра Лукашенко;
- отставки ЦИК в полном составе во главе с Лидией Ермошиной;
- признать президентские выборы сфальсифицированными и недействительными;
- привлечение к ответственности всех причастных к фальсификации подсчета голосов на выборах;
- провести новые честные выборы с прозрачным и понятным подсчетом голосов;
- прекратить применение силы и оружия со стороны силовиков в отношении мирного населения, а также незаконные аресты и задержания;
- освободить политзаключенных.

Письмо направили в Совмин, Верховный суд, Миноблисполком, Мингорисполком.
